rawData = rawData.split('\n')

let DAILY = {}

rawData.forEach(line => {
    line = line.split(' ').slice(14)
    let creationDate = line[0].slice(14)
   
    
    
    let value = Number(line[9].split('"')[1])
    
    
    DAILY[creationDate] ? DAILY[creationDate] += value : DAILY[creationDate] = value
})



let MONTHLY = {};
let INDIVIDUAL_MONTHS = {}

for(let date in DAILY){
   
    let month = date.split('-')[1]
    MONTHLY[month] ? MONTHLY[month] += DAILY[date] : MONTHLY[month] = DAILY[date]
    if (INDIVIDUAL_MONTHS[month]){
        INDIVIDUAL_MONTHS[month].push(DAILY[date])
    }
    else {
        INDIVIDUAL_MONTHS[month] = [DAILY[date]]
    }
}




export { INDIVIDUAL_MONTHS, DAILY, MONTHLY}